import React, { useState, useEffect } from 'react';

const App = () => {
  const [apiData, setApiData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:4000/api/ping/check-cctv');
        if (!response.ok) {
          throw new Error('Failed to fetch data');
        }
        const data = await response.json();
        setApiData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>API Response</h1>
      {apiData ? (
        <div>
          <p>Success: {apiData.success.toString()}</p>
          <p>Message: {apiData.message}</p>
          <p>Results: {apiData.results}</p>
          {/* Render your data based on the structure of apiData */}
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default App;
